import React from 'react';
import { Box } from "@mui/material";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import { useState, useEffect } from "react";
import { ExpandMore } from "@mui/icons-material";
import { Link } from 'react-router-dom';
// import axios from 'axios';

const Sensors = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "space-between",
                // margin: '0 auto',
                // maxWidth: '800px',
                height: "100vh",
                flexWrap: "wrap", // Allow the boxes to wrap if the screen size is too small
            }}
            >
            {/* style for column 1 */}
            <div
                style={{
                backgroundColor: "transparent",
                height: "100%",
                display: "flex",
                flexDirection: "column", // this makes it so all the boxes in column 1 are stacked like a column on top of each other
                alignItems: "center",
                justifyContent: "center",
                flex: "1", // Give equal width to each box
                minWidth: "calc(33.333% - 10px)", // Calculate the width for each box, considering the space between them
                margin: "0 5px", // Set horizontal margin to 5px for equal spacing
                marginBottom: "10px", // Set vertical margin between wrapped boxes
                }}
            >
                {/* box that surrounds fielddock logo */}
                <div
                style={{
                    backgroundColor: "transparent",
                    height: "100px",
                    display: "flex",
                    // marginTop: '14rem',
                    alignItems: "start",
                    justifyContent: "center",
                    flexDirection: "column", //this makes it so all the boxes in BOX 1 are stacked like a column  on top of each other
                }}
                >
                {/* box that CONTAINS fielddock logo */}
                <div
                    style={{
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                    width: "500px",
                    height: "100px",
                    backgroundColor: "transparent",
                    borderRadius: "10px",
                    }}
                >
                    <object
                    data="../../assets/FieldDock-Logo.svg"
                    type="image/svg+xml"
                    style={{ maxWidth: "100%", maxHeight: "100%" }}
                    width="600px"
                    height="200px"
                    />
                </div>
            </div>
            {/* Add the other columns here */}
          </div>
          <div style={{
            backgroundColor: '#ccc',
            height: '200px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}>
            Box 2
          </div>
          <div style={{
            backgroundColor: '#ccc',
            height: '200px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center'
          }}>
            Box 3
          </div>
        </div>
      );
    }

export default Sensors;
